import React, { useState } from 'react';
import { ubuntuIP } from '../../Components/constantVariable'

const ParseData = ({ rowData, onClose }) => {
  const [formData, setFormData] = useState(rowData.s_raw_pkt);
  const [fetchedData, setFetchedData] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault()
    const queryString = `?s_raw_pkt=${formData}`;
    fetch(`${ubuntuIP}/api/v0/getParsedData${queryString}`, {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => response.json())
      .then(data => {
        console.log("form DATA", formData);
        setFetchedData(data.data);
        alert('Data fetched successfully!')
      })
      .catch(error => {
        console.error('Error:', error)
        alert('Error! Please try again.')
      })
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <input type="text" value={formData} onChange={(e) => setFormData(e.target.value)} />
        <button onClick={handleSubmit}>Submit</button>
        {/* Display fetched details here */}
        {fetchedData.length > 0 && (
          <div>
            <h2>Fetched Details:</h2>
            {fetchedData.map((detail, index) => (
              <div key={index}>
                <p><strong>Packet Header:</strong> {detail.s_pkt_hdr}</p>
                <p><strong>Farmware Version:</strong> {detail.s_frmwr_ver}</p>
                <p><strong>Packet Type:</strong> {detail.s_pkt_typ}</p>
                <p><strong>Packet Status:</strong> {detail.s_pkt_status}</p>
                <p><strong>Imei No:</strong> {detail.s_imei_no}</p>
                <p><strong>Asset Id:</strong> {detail.s_asset_id}</p>
                <p><strong>i_gps_status:</strong> {detail.i_gps_status}</p>
                <p><strong>gps_dt:</strong> {detail.gps_dt}</p>
                <p><strong>gps_tm:</strong> {detail.gps_tm}</p>
                <hr />
              </div>
            ))}
          </div>
        )}
        <button onClick={onClose}>Close</button>
      </div>
    </div>
  );
};

export default ParseData;
